import Header from './Header';

const layoutStyle = {
    backgroundColor: 'rgb(118, 165, 165)',
    textAlign: 'center'
}

const Layout = (props) => (
    <div style={layoutStyle}>
        <Header />
        {props.children}
    </div>
)

export default Layout;
